import { GET_DOGS, GET_TEMPERAMENTS, GET_DOG_ID,POST_DOGS } from './actions/types';

const initialState = {
  dogs: [],
  temperaments: [],
  filters: {
    name: '',
    temperament: '',
    weight: '',
    height: '',
    life_span: '',
  },
};

const reducer = (state = initialState, { type, payload }) => {
  switch (type) {
    case GET_DOGS:
            return {
                 ...state,

             }
    case GET_TEMPERAMENTS:
            return {
              ...state,

            };
    case GET_DOG_ID:
            return {
              ...state,

            };
    case POST_DOGS:
            return {
              ...state,

            };                                    
    default:
      return state;
  }
};

export default dogReducer;
